text:
Привеееет!

Я сейчас помогаю молодой компании NtechLab, ребята разрабатывают передовые продукты на базе собственной технологии распознавания лиц, лучшей в мире. Например, недавно они получили первое место в соревновании, которое организовала IARPA, также они постоянно в лидерах тестирования FRVT NIST. Ребята создают крутые продукты и сервисы, которые меняют рынок, предоставляют своим клиентам функционал, который полтора года назад работал только в боевиках с Джейсоном Борном. Помогают снизить преступность в Москве, анализируя видеопотоки с подъездных камер.
Среди клиентов компании: крупнейшие государственные  структуры, финансовые институты, предприятия розничной торговли.
Алгоритм NtechLab превосходит по качеству алгоритм Google.
Если вы энергичный и целеустремленный профессионал, предпочитаете динамичную стартап-культуру бюрократии, то нам нужно срочно познакомиться! А резюме можно направлять мне, я буду рада поделиться деталями: <mailto:hr@ntechlab.com|hr@ntechlab.com>

Вы нам подойдете, если
- у вас есть высшее техническое образование;
- вы обладаете хорошей математической подготовкой;
- у вас есть знания алгоритмов машинного обучения и нейронных сетей и большой практический опыт их применения;
- у вас есть опыт работы хотя бы с одной из библиотек: pytorch, mxnet, tensorflow, caffe;
- вы любите Python;
- у вас есть базовые знания C++.

Будет плюсом:
- опыт разработки на CUDA;
- участие в kaggle соревнованиях;
- опыт продакшн-разработки;
- интерес к области распознавания лиц;
- умение самостоятельно продумывать и делать эксперименты от момента постановки задачи до получения желаемого результата.

Примеры задач, которыми занимается лаборатория:
- участие в создании алгоритмов распознавания лиц для соревнования NIST FRVT;
- улучшение точности и скорости работы алгоритмов распознавания лиц;
- улучшение точности и скорости работы алгоритмов детектирования объектов;
- разработка алгоритмов распознавания объектов на видео.

Вас ждет
- белая заработная плата - до 300 тыр на руки;
- работа в команде экспертов по нейронным сетям;
- участие в международных соревнованиях по распознаванию лиц;
- интересные и сложные задачи по машинному обучению;
- топовые сервера для обучения нейронных сетей, включая nvidia dgx-1;
- премии по результатам работы в каждом полугодии;
- удобное расположение рядом с метро Белорусская;
- большая веранда с настольным теннисом;
- ДМС после испытательного срока, бесплатные фрукты, смузи, чай, кофе.
